from typing import List

class Solution:
    def minSum(self, nums1: List[int], nums2: List[int]) -> int:
        sum1, sum2 = sum(nums1), sum(nums2)
        diff = abs(sum1 - sum2)
        zeros1, zeros2 = nums1.count(0), nums2.count(0)

        if zeros1 + zeros2 == 0:
            return sum1 if sum1 == sum2 else -1

        total_zeros = zeros1 + zeros2
        min_increase_per_zero = (diff + total_zeros - 1) // total_zeros

        if sum1 < sum2:
            new_sum1 = sum1 + min_increase_per_zero * zeros1
            new_sum2 = sum2 + min_increase_per_zero * zeros2
        else:
            new_sum1 = sum1 + min_increase_per_zero * zeros1
            new_sum2 = sum2 + min_increase_per_zero * zeros2

        if new_sum1 != new_sum2:
            return -1

        return new_sum1
